import 'tachyons';
import mail from '../../Images/mail.jpg'


class Contact extends Component {
    render(){
        return(
            <div className='dib w-100 border-box fl w-100'>
                {/* <section className ='dib pa6 mr3 fl w-14'></section> */}
                <section className ='center w-100-m w-75-l pr2 pl3 pt1 pb2 bg-white o-90 pa2'>
                    <div>
                        <h1 className='tc black'>Contact Us</h1>
                        <article className='dt dt--fixed w-80 center'>
                            <div className=''>
                                <p>Feel free to call or write to us</p>
                            </div>
                        </article>
                        <article class="cf ">
                            <div class="fl w-20 bg-near-white tc">
                            <img src={mail} className='h3' alt = 'Email'/>
                            </div>
                            <div class="fl w-70 bg-light-gray black">
                                <h1>aakruthi2k19@gmail.com</h1>
                            </div>
                        </article>
                        <article class="cf ">
                            <div class="fl w-20 bg-near-white tc">
                            <img src={mail} className='h3' alt = 'Email'/>
                            </div>
                            <div class="fl w-70 bg-light-gray black">
                                <h1>aakruthi2k19@gmail.com</h1>
                            </div>
                        </article>
                    </div>    
                </section>
                {/* <section className ='dib m0 mb0 pa5 fl w-15'></section> */}
            </div>
        );
    }
}

export default Contact;
